import styled from 'styled-components';

const Logo = styled.div`
  width: 100%;
  display: flex;
  align-items: flex-start;
  justify-content: flex-start;
  padding: 1.6rem;
  padding-left: 7.2rem;

  img {
    width: 8.8rem;
  }
`;

export default Logo;
